import React from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    axios.get('/api').then((res) => {
      console.log({ res });
      setData(res.data);
    });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>{!data ? 'Loading...' : data}</p>
      </header>
    </div>
  );
}

export default App;
